- input: "TEXT\x1CC00449801\x1C.TEXT\x1C\x1CF3XA\x1CThis submission responds to the
    Commission's letter of November 21, 2008 regarding the committee's October Quarterly
    Report.  1 & 2)  The committee excercises best efforts, Schedule A has been amended
    to correct errors and omissions.  The occupation of self/self-employed was provided
    by the donors through a third party conduit, ActBlue.  3)  Expenditures for beverages,
    catering and food were for committee fundraising and not on behalf of any candidate.
    4) Payements for ad production, audio visual,  t-shirt design and web advertising
    were for committee operating expenses and not on behalf of any federal candidate
    \ 5)  Schedule E has been amended to correct this error.  6)  A payment to Alfred
    Rotondaro relates back to additional funds from an independent expenditure paid
    in May 2008.  This additional amount was an additional charge that was unanticipated
    at the time the original Form 5 was submitted.  A Payment to Eric Sapp in the
    amount of $2,641.14 relates to payments disclosed to Eleison Group on Form 24
    in the amounts of $1061.14 and $1580.  Eleison Group is a dba of Mr. Sapp.  The
    additonal payment of $2,641.14 was inadvertently omitted from the Form 24.  The
    payment to Eleison Group was inadvertently omitted from the report.  7)  See answer
    to question 6  8)  "
